    _ownerTokens[signer][tokenURI] = nextTokenId;
    return nextTokenId++;
  }

  function verifyByTokenURI(
    address signer,
    string calldata tokenURI
  ) public view returns (bool) {
    uint256 tokenId = _ownerTokens[signer][tokenURI];
    return _ownerOf(tokenId) == signer;
